import React from 'react';
import logo from './logo.svg';
import './App.css';
import Phone from './components/Phone/Phone';

function App() {

    React.useEffect(() => {
      fetch("/api")
        .then((res) => res.json())
        .then((data) => setData(data.message));
    }, []);

    return (
      <div>
        <Phone />
      </div>
    );
  }

  export default App;
